import React from 'react';
import './css/Content.css';
import Parse from 'parse';

export default class Content extends React.Component {

    componentWillMount(){
        this.checkLogIn();
    }

    checkLogIn(){
        let url = window.location.href;
        let cont = url.split('?');
        //alert('Email: ' + atob(cont[1]) + "\nSenha: " + atob(cont[2]));
        Parse.User.logIn(atob(cont[1]), atob(cont[2]))
        .then(
            (result) => {
                alert('Confirmado');
            },
            (err) => {
                alert(err.message);
            }
        );
    }

    render(){
        return(
            <div className="content">
                
            </div>
        );
    }
}
